import React from "react";

const Index = (props) => {
  return (
    <tr>
      <td>
        <input type="checkbox" />
      </td>
      <td>{}</td>
      <td>123</td>
      <td>
        <span className="p-1 bg-success text-white rounded">Active</span>
      </td>
      <td>
        <span className="p-1 bg-warning rounded">Admin</span>
      </td>
      <td>
        <button className="btn shadow-none fas fa-trash"></button>
        <button className="btn shadow-none fas fa-edit"></button>
      </td>
    </tr>
  );
};

export default Index;
